import React, {Component} from 'react';

class HeaderBottom extends Component {
    render() {
        return (
            <div className="header-bottom wrapper">
                <div className="logo" >
                    DOYOGA
                </div>
                <div className="menu">
                    <ul>
                        <li>Home</li>
                        <li>Classes</li>
                        <li>Pages</li>
                        <li>About</li>
                        <li>Events</li>
                        <li>Gallery</li>
                        <li>Contact</li>
                    </ul>
                </div>
            </div>
        );
    }
}

export default HeaderBottom;
